import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import Landing from './pages/landing';
import Login from './pages/login';
import Dashboard from './pages/Dashboard';
import Upload from './pages/upload';
import Result from './pages/result';
import LoginButton from './components/loginButton'; // ✅ import login/logout button

function App() {
  return (
    <BrowserRouter>
      {/* Navbar/Header */}
      <header className="bg-gray-800 text-white px-4 py-3 flex justify-between items-center">
        <Link to="/" className="text-xl font-bold">Resume Analyzer</Link>
        <LoginButton />
      </header>

      {/* Main Routing Area */}
      <Routes>
        <Route path="/" element={<Landing />} />
        <Route path="/login" element={<Login />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/upload" element={<Upload />} />
        <Route path="/result" element={<Result />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
